import React from "react";

const Cell = (props) => {
  // object destructuring
  const student = {
    name: "evondev",
    age: 28,
  };
  return (
    <div className="game-cell" onClick={props.onClick}>
      {props.value}
    </div>
  );
};

export default Cell;
